The Message trait is protocol agnostic and only provides serialization and deserialization to and from byte buffers. It should not be used as is but rather be paired with a higher layer - like a type-length-value encoding - and as such does not provide any bounds check on inputs/outputs buffers. /// A trait describing the behavior of a message.
trait Message { /// The unique identifier of the message within the protocol. const ID: u8; /// Returns the size range of the message as it can be compressed. fn size_range() -> Range<usize>; /// Deserializes a byte buffer into a message. /// Panics if the provided buffer has an invalid size. /// The size of the buffer should be within the range returned by the `size_range` method. fn from_bytes(bytes: &[u8]) -> Self; /// Returns the size of the message. fn size(&self) -> usize; /// Serializes a message into a byte buffer. /// Panics if the provided buffer has an invalid size. /// The size of the buffer should be equal to the one returned by the `size` method. fn into_bytes(self, bytes: &mut [u8]);
} Notes : size_range returns an allowed range for the message size because some parts of some messages can be trimmed. It is used to check if a message coming from a transport layer has a valid size. More details on compression below; from_bytes/into_bytes panic if incorrectly used, only the following safe TLV module should directly use them; into_bytes does not allocate a buffer because the following TLV protocol implies concatenating a header inducing another allocation. Since this is a hot path, a slice of an already allocated buffer for both the header and payload is expected; hence, limiting the amount of allocation to the bare minimum;

